import React, { useState, useEffect } from "react";

function Country1() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("https://dog.ceo/api/")
      .then((resp) => resp.json())
      .then((apiData) => {
        setData(apiData);
        console.log(data);
      });
  }, []);

  return (
    <div>
      <img src={data} width={500}></img>
    </div>
  );
}
export default Country1;

